import React,{useState} from 'react'
import Book from "../Components/Book"
import '../../src/Style.css'
const TableBox= (props)=>{
    const Books = props.Books;
    var uniqueBooks =[];
   //var uniqueBooks = [...new Set(Books)]
 function onlyUnique(value, index, self) { 
     console.log(index,self.indexOf(value))
    return self.indexOf(value) === index;
}
function eliminateDuplicates(arr) {
    var i,
        len = arr.length,
        out = [],
        obj = {};
  
    for (i = 0; i < len; i++) {
      obj[arr[i]] = 0;
    }
    for (i in obj) {
      out.push(i);
    }
    return out;
  }
    uniqueBooks = eliminateDuplicates(Books)

    console.log(uniqueBooks)
    //console.log("dd")
    return (<div className="tableBox">
        {uniqueBooks.map((book)=>{
       return <Book key={book.id}  id={book.id} title={book.bookname} author={book.author} price={book.price} imagepath={book.imagepath}/>
        })}
    </div>)
}
export default TableBox;
